  return (
    <div className="page-grid">
      <p>pageGrid</p>
      <div
        style={{ display: "flex", flexDirection: "row", gap: "4px" }}
        className="gray"
      >
        <div
          style={{ backgroundColor: "var(--primary)" }}
          className="colorCheck"
        />
      </div>
      <div
        style={{ display: "flex", flexDirection: "row", gap: "4px" }}
        className="gray"
      >
        <div style={{ backgroundColor: "var(--)" }} className="colorCheck" />
      </div>
    </div>
  );
}
